import Home from "./pages/Home";
import About from "./pages/About.js";
import './App.css';

import { Box } from '@mui/system';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";

const style = {
  textDecoration:'none',
  marginRight: 10,
  fontSize:25,
  color: 'black'
};

function App() {
  return (
    <div className="App">
        <Box component="section" sx={{ p: 3,marginBottom: '20px', border: '1px dashed grey',}}>
          <Router>
            <Routes>
              <Route path="/" element={<Layout />}>
                <Route index element={<Home />}/>
                <Route path="blogs" element={<About />} />
              </Route>
            </Routes>
          </Router>
        </Box>
    </div>
  );
}

export default App;
